const zipMagicBytes = [0x50, 0x4B, 0x03, 0x04];
const isZipFile = hasMagicBytes(zipMagicBytes);

const gzMagicBytes = [0x1F, 0x8B, 0x08];
const isGzFile = hasMagicBytes(gzMagicBytes);

